<#
.SYNOPSIS
    Tic Tac Toe game with AI using Minimax algorithm.

.ANOTHER
    Colin Heggli

.DESCRIPTION
    Tic Tac Toe game with AI using Minimax algorithm.

    The game is played on a 3x3 grid. The game is played by two players, one of which is the computer.
    The computer uses the Minimax algorithm to determine the best move to make.
    The game is won by the player who gets three of their marks in a row, either horizontally, vertically, or diagonally.
    The game is a tie if the board is full and no player has won.
#>

param (
    [Alias('c')]
    [Switch]$FIRST_COMPUTER_MOVE_RANDOM = $true,
    [Alias('n')]
    [Switch]$FIRST_NEURAL_NETWORK_MOVE_RANDOM = $true,
    [Alias('p')]
    [Switch]$FIRST_MOVE_BY_PLAYER = $false,
    [Alias('p1')]
    [String]$player1 = "X",
    [Alias('p2')]
    [String]$player2 = "O",
    [Alias('h')]
    [Switch]$Help
)

$Global:FIRST_COMPUTER_MOVE_RANDOM = $FIRST_COMPUTER_MOVE_RANDOM
$Global:FIRST_NEURAL_NETWORK_MOVE_RANDOM = $FIRST_NEURAL_NETWORK_MOVE_RANDOM
$Global:FIRST_MOVE_BY_PLAYER = $FIRST_MOVE_BY_PLAYER
$Global:player1 = $player1
$Global:player2 = $player2


Function Show-MenuSelect
{

    Param(
        [Parameter(Mandatory = $True)][String]$MenuTitle,
        [Parameter(Mandatory = $True)][String]$MenuBanner,
        [Parameter(Mandatory = $True)][array]$MenuOptions
    )

    $MaxValue = $MenuOptions.count - 1
    $Selection = 0
    $EnterPressed = $False

    Clear-Host

    While ($EnterPressed -eq $False)
    {
        if ($MenuBanner.Length -ne 1)
        {
            Write-Host "$MenuBanner"
        }
        Write-Host "$MenuTitle"

        For ($i = 0; $i -le $MaxValue; $i++) {

            If ($i -eq $Selection)
            {
                Write-Host -BackgroundColor DarkGray -ForegroundColor White "[ $( $MenuOptions[$i] ) ]"
            }
            Else
            {
                Write-Host "  $( $MenuOptions[$i] )  "
            }

        }

        $KeyInput = $host.ui.rawui.readkey("NoEcho,IncludeKeyDown").virtualkeycode

        Switch ($KeyInput)
        {
            13 {
                $EnterPressed = $True
                Return $Selection
                Clear-Host
                break
            }

            38 {
                If ($Selection -eq 0)
                {
                    $Selection = $MaxValue
                }
                Else
                {
                    $Selection -= 1
                }
                Clear-Host
                break
            }

            40 {
                If ($Selection -eq $MaxValue)
                {
                    $Selection = 0
                }
                Else
                {
                    $Selection += 1
                }
                Clear-Host
                break
            }
            27 {
                Return -1
            }
            Default {
                Clear-Host
            }
        }
    }
}

function Write-Board($board)
{
    return @"
          +         +
          |         |
     $( $board[0][0] )    |    $( $board[0][1] )    |    $( $board[0][2] )
          |         |
+---------+---------+---------+
          |         |
     $( $board[1][0] )    |    $( $board[1][1] )    |    $( $board[1][2] )
          |         |
+---------+---------+---------+
          |         |
     $( $board[2][0] )    |    $( $board[2][1] )    |    $( $board[2][2] )
          |         |
          +         +
"@
}



$scores = @{
    $player1 = +10
    $player2 = -10
    tie = 0
}

function Get-Winner
{
    param (
        $board
    )
    $winner = $null
    # Check rows and columns
    for ($i = 0; $i -lt 3; $i++) {
        if ($board[$i][0] -eq $board[$i][1] -and $board[$i][1] -eq $board[$i][2])
        {
            $winner = $board[$i][0]
        }
        if ($board[0][$i] -eq $board[1][$i] -and $board[1][$i] -eq $board[2][$i])
        {
            $winner = $board[0][$i]
        }
    }
    # Check diagonals
    if ($board[0][0] -eq $board[1][1] -and $board[1][1] -eq $board[2][2])
    {
        $winner = $board[0][0]
    }
    if ($board[0][2] -eq $board[1][1] -and $board[1][1] -eq $board[2][0])
    {
        $winner = $board[0][2]
    }
    # Check for tie
    $tie = $true
    for ($i = 0; $i -lt 3; $i++) {
        for ($j = 0; $j -lt 3; $j++) {
            if (@("1", "2", "3", "4", "5", "6", "7", "8", "9") -contains $board[$i][$j])
            {
                $tie = $false
            }
        }
    }
    if ($tie -and $null -eq $winner)
    {
        $winner = "tie"
    }
    return $winner
}


function Convert-BoardToAiFormat
{
    param (
        $board
    )
    $flaten_board = ($board -join " ")
    [Double[]]$aiBoard = [Double[]]@()
    $flaten_board.split() | ForEach-Object {
        if ($_ -eq $player1)
        {
            $aiBoard += ,0
            $aiBoard += ,1
            $aiBoard += ,0
        }
        elseif ($_ -eq $player2)
        {
            $aiBoard += ,0
            $aiBoard += ,0
            $aiBoard += ,1
        }
        else
        {
            $aiBoard += ,1
            $aiBoard += ,0
            $aiBoard += ,0
        }
    }
    return $aiBoard
}

function Get-MiniMax
{
    param (
        $board,
        $depth,
        $isMaximizing,
        [ref]$alpha,
        [ref]$beta
    )
    $Global:recursions++
    $winner = Get-Winner $board
    if ($null -ne $winner)
    {
        return $scores.$winner
    }

    if ($isMaximizing)
    {
        $bestScore = -999
        for ($i = 0; $i -lt 3; $i++) {
            for ($j = 0; $j -lt 3; $j++) {
                if (@("1", "2", "3", "4", "5", "6", "7", "8", "9") -contains $board[$i][$j])
                {
                    $tmp = $board[$i][$j]
                    $board[$i][$j] = $player1
                    $score = Get-MiniMax $board ($depth + 1) $false ([ref]$alpha.Value) ([ref]$beta.Value)
                    $board[$i][$j] = $tmp
                    $bestScore = [math]::Max($bestScore, $score)
                    $alpha.Value = [math]::Max($alpha.Value, $score)
                    if ($beta.Value -le $alpha.Value)
                    {
                        break
                    }
                }
            }
            if ($beta.Value -le $alpha.Value)
            {
                break
            }
        }
        return $bestScore
    }
    else
    {
        $bestScore = 999
        for ($i = 0; $i -lt 3; $i++) {
            for ($j = 0; $j -lt 3; $j++) {
                if (@("1", "2", "3", "4", "5", "6", "7", "8", "9") -contains $board[$i][$j])
                {
                    $tmp = $board[$i][$j]
                    $board[$i][$j] = $player2
                    $score = Get-MiniMax $board ($depth + 1) $true ([ref]$alpha.Value) ([ref]$beta.Value)
                    $board[$i][$j] = $tmp
                    $bestScore = [math]::Min($bestScore, $score)
                    $beta.Value = [math]::Min($beta.Value, $score)
                    if ($beta.Value -le $alpha.Value)
                    {
                        break
                    }
                }
            }
            if ($beta.Value -le $alpha.Value)
            {
                break
            }
        }
        return $bestScore
    }
}


function Get-AlgorithmMiniMaxMove
{
    param (
        $board
    )
    Write-Host "Computer is thinking..."
    $Global:recursions = 0
    $start = Get-Date
    $bestScore = -999
    $move = @()
    for ($i = 0; $i -lt 3; $i++) {
        for ($j = 0; $j -lt 3; $j++) {
            if (@("1", "2", "3", "4", "5", "6", "7", "8", "9") -contains $board[$i][$j])
            {
                $tmp = $board[$i][$j]
                $board[$i][$j] = $player1
                $alpha = [ref](-999)
                $beta = [ref](999)
                $score = Get-MiniMax $board 0 $false $alpha $beta
                $board[$i][$j] = $tmp
                if ($score -gt $bestScore)
                {
                    $bestScore = $score
                    $move = @($i, $j)
                }
            }
        }
    }
    $end = Get-Date
    Write-Host "Time: $( $end - $start )"
    Write-Host "Recursions: $( $Global:recursions )"
    return $move
}
function Convert-Predictions
{
    param (
        [double[]]$predictions
    )
    # Find the maximum value in the predictions
    $max_value = $predictions | Measure-Object -Maximum | Select-Object -ExpandProperty Maximum

    # Initialize the converted predictions array
    $converted_predictions = @()

    # Convert predictions to 1 if they are equal to the maximum value, otherwise to 0
    for ($i = 0; $i -lt $predictions.Length; $i++) {
        if ($predictions[$i] -eq $max_value)
        {
            $converted_predictions += 1
        }
        else
        {
            $converted_predictions += 0
        }
    }

    return $converted_predictions
}

function Convert-BiasToDoubleArray
{
    param(
        [string]$csvFilePath
    )
    $array = @()
    $lines = Get-Content -Path $csvFilePath
    foreach ($line in $lines)
    {
        $array += [double]$line
    }
    return $array
}

# Function to convert weights CSV file to double array
function Convert-WeightsToDoubleArray
{
    param(
        [string]$csvFilePath
    )
    $array = @()
    $lines = Get-Content -Path $csvFilePath
    Set-Clipboard -Value $lines
    foreach ($line in $lines)
    {
        $weights = $line -split ';'
        $doubleWeights = $weights | ForEach-Object { [double]$_ }
        $array += ,@($doubleWeights)
    }
    return $array
}

