$biases_layer_0 = Convert-BiasToDoubleArray "$env:TMP\TTTAI\bias_layer_0.csv"
$weights_layer_1 = Convert-WeightsToDoubleArray "$env:TMP\TTTAI\weight_layer_1.csv"
$biases_layer_1 = Convert-BiasToDoubleArray "$env:TMP\TTTAI\bias_layer_1.csv"
$weights_layer_2 = Convert-WeightsToDoubleArray "$env:TMP\TTTAI\weight_layer_2.csv"
$biases_layer_2 = Convert-BiasToDoubleArray "$env:TMP\TTTAI\bias_layer_2.csv"
$weights_layer_3 = Convert-WeightsToDoubleArray "$env:TMP\TTTAI\weight_layer_3.csv"
$biases_layer_3 = Convert-BiasToDoubleArray "$env:TMP\TTTAI\bias_layer_3.csv"
$weights_layer_4 = Convert-WeightsToDoubleArray "$env:TMP\TTTAI\weight_layer_4.csv"
$biases_layer_4 = Convert-BiasToDoubleArray "$env:TMP\TTTAI\bias_layer_4.csv"


function Start-ApplyLayer
{
    param(
        [double[]]$input_data,
        $weights,
        [double[]]$biases,
        [string]$activation
    )
    [Double[]]$output_data = @()
    $rows = $weights.Length
    $cols = $weights[0].length

    for ($i = 0; $i -lt $cols; $i++) {
        [Double]$sum = 0
        for ($j = 0; $j -lt $rows; $j++) {
            $sum += $input_data[$j] * $weights[$j][$i]
        }
        $sum += $biases[$i]
        if ($activation -eq "relu")
        {
            $output_data += [Double]([Math]::Max([Double]0, [Double]$sum))
        }
        elseif ($activation -eq "linear")
        {
            $output_data += $sum
        }
        elseif ($activation -eq "sigmoid")
        {
            $output_data += 1 / (1 + [Math]::Exp(-$sum))
        }

    }
    return $output_data
}


function Convert-BoardFromAI
{
    param (
        [double[]]$board,
        $original_board
    )
    $flaten_board = ($original_board -join "").replace(" ", "")
    $new_board = @(
        @($flaten_board[0], $flaten_board[1], $flaten_board[2]),
        @($flaten_board[3], $flaten_board[4], $flaten_board[5]),
        @($flaten_board[6], $flaten_board[7], $flaten_board[8])
    )

    $flat_board_index = 0

    for ($i = 0; $i -lt 3; $i++) {
        for ($j = 0; $j -lt 3; $j++) {
            if ($flaten_board[$flat_board_index] -ne $Global:player1 -and $flaten_board[$flat_board_index] -ne $Global:player2 -and $board[$flat_board_index] -eq 1)
            {
                $new_board[$i][$j] = $Global:player1
            }
            $flat_board_index++
        }
    }

    return $new_board
}


function Get-EvalBoard
{
    param (
        $original_board,
        $ai_board
    )

    $flaten_board = ($original_board -join "").replace(" ", "")
    $valid = $true

    for ($i = 0; $i -lt 9; $i++) {
        if (($flaten_board[$i] -eq $Global:player1 -or $flaten_board[$i] -eq $Global:player2) -and $ai_board[$i] -eq 1)
        {
            $valid = $false
        }
    }
    return $valid
}

function Get-AIMove
{
    param (
        [string[]]$input_board
    )

    [Double[]]$input_data = Convert-BoardToAiFormat -board $input_board

    [Double[]]$output_layer0 = Start-ApplyLayer -input_data $input_data -weights $weights_layer_0 -biases $biases_layer_0 -activation "relu"
    [Double[]]$output_layer1 = Start-ApplyLayer -input_data $output_layer0 -weights $weights_layer_1 -biases $biases_layer_1 -activation "relu"
    [Double[]]$output_layer2 = Start-ApplyLayer -input_data $output_layer1 -weights $weights_layer_2 -biases $biases_layer_2 -activation "relu"
    [Double[]]$output_layer3 = Start-ApplyLayer -input_data $output_layer2 -weights $weights_layer_3 -biases $biases_layer_3 -activation "relu"
    [Double[]]$output_layer = Start-ApplyLayer -input_data $output_layer3 -weights $weights_layer_4 -biases $biases_layer_4 -activation "linear"

    $ai_board = Convert-Predictions -predictions $output_layer
    $valid = Get-EvalBoard -original_board $input_board -ai_board $ai_board

    $new_board = Convert-BoardFromAI -board $ai_board -original_board $input_board

    if ($valid)
    {
        return $new_board
    }
    else
    {
        Write-Error "Invalid move by AI"
        exit 1
    }
}

function Start-GameLoopPVP
{
    $board = @(
        @("7", "8", "9"),
        @("4", "5", "6"),
        @("1", "2", "3")
    )
    $CurrentPlayer = $player1

    While ($true)
    {
        $winner = Get-Winner $board
        if ($winner)
        {
            clear-host
            Write-Board $board
            Write-Host "$winner has won!!!"
            return
        }
        $selecting = $true
        while ($selecting)
        {
            Clear-Host
            Write-Board $board
            Write-Host "Choose your move player: $CurrentPlayer"
            $human = Read-Host ">> "
            if (@("1", "2", "3", "4", "5", "6", "7", "8", "9") -contains $human)
            {
                for ($i = 0; $i -lt 3; $i++) {
                    for ($j = 0; $j -lt 3; $j++) {
                        if ($human -contains $board[$i][$j])
                        {
                            $board[$i][$j] = $CurrentPlayer
                            If ($CurrentPlayer -eq $player1)
                            {
                                $CurrentPlayer = $player2
                            }
                            else
                            {
                                $CurrentPlayer = $player1
                            }
                            $selecting = $false
                        }
                    }
                }
            }
        }
    }
}


