function Write-Info
{

    Clear-Host
    @"
TIC TAC TOE

A game we all know and love...

COMMAND
    TTT.ps1 [-player1 <string>] [-player2 <string>] [-FIRST_COMPUTER_MOVE_RANDOM] [-FIRST_NEURAL_NETWORK_MOVE_RANDOM] [-FIRST_MOVE_BY_PLAYER] [-help]

    -player1, -p1                           The symbol for player 1 (default: X)
    -player2, -p2                           The symbol for player 2 (default: O)
    -FIRST_COMPUTER_MOVE_RANDOM, -c         If set to true the computer will make the first move randomly (default: true)
    -FIRST_NEURAL_NETWORK_MOVE_RANDOM, -n   If set to true the neural network will make the first move randomly (default: true)
    -FIRST_MOVE_BY_PLAYER, -p               If set to true the player will make the first move (default: false)
                                            Will override FIRST_COMPUTER_MOVE_RANDOM and FIRST_NEURAL_NETWORK_MOVE_RANDOM to false
    -help, -h                               Show this help message

ABOUT
    Colin Heggli
    Copyright (c) $( (Get-Date).Year )

MODES
    PvP - (Play against a friend)
        In this mode you play against andother person.
    PvR - (Random)
        In this mode you play against the computer that makes random moves.
    PvC - (minimax + alpha-beta)
        In this mode you play against the computer using the minimax algorithm with alpha-beta pruning.
        This algorithm is used to determine the best move by going through all possible moves and selecting the best one.
        To achieve this the algorithm uses a recursive function to simulate all possible moves.
        The alpha-beta pruning is used to reduce the number of nodes that are evaluated by the minimax algorithm in its search tree,
        by eliminiating cases that are not gone to be selected.
    PvAi - (5 layers neural network)
        This is an neural network that has been trained to play tic tac toe with 30000 samples of fields
        and best next moves generated by the minimax algorithm.
        The neural network is structured as following
        - 27 input nodes, beginning at the top left (1, 0, 0) represents a blank field,
          (0, 1, 0) represents player 1 / ai and (0, 0, 1) represents player 2
        - 45 hidden nodes with a relu activation function
        - 65 hidden nodes with a relu activation function
        - 45 hidden nodes with a relu activation function
        - 16 hidden nodes with a relu activation function
        - 9 output nodes with a linear activation function
        The neural network is trained with a mean squared error loss function and an adam optimizer.
        It was trained with 32 epochs and a batch size of 42.

        STATS
            Total connections: 27 * 45 + 45 * 65 + 65 * 45 + 45 * 16 + 16 * 9 = 7929
            Total biases: 45 + 65 + 45 + 16 + 9 = 181
            Total parameters: 7929 + 181 = 8110
            Total training time: 42 seconds
            Accuracy: 0.999 (completely correct moves)
            Accuracy: 1.0 (Not correct but valid moves)







"@ | Write-Host

}

function Start-Main
{

    $choice = Show-MenuSelect "Choose your mode" " " "PvP - (Play against a friend)", "PvR - (Random Moves)","PvC - (minimax + alpha-beta)", "PvAi - (5 layers neural network)", "INFO"
    Switch ($choice)
    {
        0 {
            Start-GameLoopPVP
        }
        1 {
            Start-GameLoopRandom
        }
        2 {
            Start-GameLoopAlgorithmMiniMax
        }
        3 {
            Start-GameLoopAI
        }
        4 {
            Write-Info
        }
        -1 {
            exit
        }
    }
}

if ($Help) {
    Write-Info
    exit
}
else
{
    Start-Main
}
